import React from 'react';
import { Container, Advertising } from './styles';
import { Button } from '@bentcare/core';

const FirstSection: React.FC = () => {
  return (
    <Container>
      <Advertising>
        <div>
          <p>
            <strong>Clube de Vantagens Bentcare</strong>
            <br />
            Cuide da sua saúde com <br /> <strong>preço baixo</strong> e
            agilidade
          </p>
          <div>
            <Button label="Conhecer planos" />
            <Button label="Ligamos para você" />
          </div>
        </div>
      </Advertising>
    </Container>
  );
};

export default FirstSection;
